import React from 'react';
import {FlatList,StyleSheet,Text,View,Image} from 'react-native';

class feed extends React.Component{

    constructor(props){
        super(props);
        this.state={
            photo_feed:[0,1,2,3,4],
            refresh: false
        }
    }
        loadNew =()=>{
            this.setState({
                refresh:true
            });
            this.setState({
                photo_feed:[5,6,7,8,9],
                refresh:false
            })
        }
    render(){
        return(
            <View style={{flex:1}}>
                <View style={{height:70,padding:30,backgroundColor:'white',borderColor:'lightgray',borderBottomWidth:0.5,justifyContent:'center',alignItems:'center'}}>
                    <Text>FEED</Text>
                </View>
             
                <FlatList 
                    refreshing={this.state.refresh}
                    onRefresh={this.loadNew}
                    data={this.state.photo_feed}
                    keyExtractor={(item,index)=> index.toString()}
                    style={{flex:1,backgroundColor:'#eee'}}
                    renderItem={({item,index})=> (
                    <View key={index}>
                            <View>
                                <Text>Time</Text>
                                <Text>@Rusty</Text>
                            </View>
                        <View>
                            <Image
                                 source={{uri:'https://source.unsplash.com/random/500x'+Math.floo((Math.random() * 800) + 500) }}
                                 style ={{resizeMode:'cover',width:'100%',height:275}}/>
                        </View>
                    <View>
                        <Text>Caption text</Text>
                        <Text>View comments...</Text>
                    </View>
                    </View>
                )}
                />
            </View>    
        )
    }
}

